# Given a binary array nums, return the maximum length of a contiguous subarray with an equal number of 0 and 1.

# 1 <= nums.length <= 10^5
# nums[i] is either 0 or 1.

# @param {Integer[]} nums
# @return {Integer}
def find_max_length(nums)
    max, balance = 0,0
    ocurrence_array = {0=>-1}
    nums.each_with_index do |num,index|
        balance += num==0?-1:1
        if ocurrence_array.has_key? balance 
            max = [max,index-ocurrence_array[balance]].max
        else
            ocurrence_array[balance] = index
        end
    end
    max
end

